vector<string> separate_paren_groups(string paren_string){
    // Remove all spaces from the input string
    paren_string.erase(remove_if(paren_string.begin(), paren_string.end(), ::isspace), paren_string.end());

    vector<string> result;
    int balance = 0;
    string current_group;

    for (char c : paren_string) {
        current_group += c;
        if (c == '(') {
            balance++;
        } else {
            balance--;
        }

        // When balance reaches zero, we have a complete group
        if (balance == 0) {
            result.push_back(current_group);
            current_group.clear();
        }
    }

    return result;
}

