int how_many_times(string str, string substring) {
    int count = 0;
    int len_str = str.size();
    int len_sub = substring.size();

    if (len_sub == 0 || len_str < len_sub) {
        return 0;
    }

    for (int i = 0; i <= len_str - len_sub; ++i) {
        string current = str.substr(i, len_sub);
        if (current == substring) {
            count++;
        }
    }

    return count;
}

