int largest_divisor(int n) {
    if (n <= 1) return -1; // No proper divisor for numbers less than or equal to 1

    for (int i = n - 1; i >= 2; --i) {
        if (n % i == 0) {
            return i;
        }
    }

    return 1; // If no other divisors found, the largest proper divisor is 1
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (largest_divisor(3) == 1);
    assert (largest_divisor(7) == 1);
    assert (largest_divisor(10) == 5);
    assert (largest_divisor(100) == 50);
    assert (largest_divisor(49) == 7);
}

