vector<int> factorize(int n) {
    vector<int> factors;
    int i = 2;
    while (i * i <= n) {
        if (n % i == 0) {
            while (n % i == 0) {
                factors.push_back(i);
                n /= i;
            }
        }
        i++;
    }
    if (n > 1) {
        factors.push_back(n);
    }
    return factors;
}

