vector<int> remove_duplicates(vector<int> numbers) {
    unordered_map<int, int> counts;

    // First pass: count frequencies
    for (int num : numbers) {
        counts[num]++;
    }

    // Second pass: collect elements with frequency 1
    vector<int> result;
    for (int num : numbers) {
        if (counts[num] == 1) {
            result.push_back(num);
        }
    }

    return result;
}

