using namespace std;

string sort_numbers(string numbers) {
    // Split the input string into individual words
    vector<string> words;
    stringstream ss(numbers);
    string word;
    while (ss >> word) {
        words.push_back(word);
    }

    // Mapping from word to number
    unordered_map<string, int> word_to_num = {
        {"zero", 0},
        {"one", 1},
        {"two", 2},
        {"three", 3},
        {"four", 4},
        {"five", 5},
        {"six", 6},
        {"seven", 7},
        {"eight", 8},
        {"nine", 9}
    };

    // Convert words to corresponding numbers
    vector<int> nums;
    for (const auto& w : words) {
        nums.push_back(word_to_num[w]);
    }

    // Sort the numbers
    sort(nums.begin(), nums.end());

    // Mapping from number back to word using an array for efficiency
    const vector<string> num_to_word = {
        "zero", "one", "two", "three", "four",
        "five", "six", "seven", "eight", "nine"
    };

    // Convert sorted numbers back to words
    vector<string> sorted_words;
    for (int n : nums) {
        sorted_words.push_back(num_to_word[n]);
    }

    // Join the words into a single string separated by spaces
    string result = "";
    for (size_t i = 0; i < sorted_words.size(); ++i) {
        if (i != 0) {
            result += " ";
        }
        result += sorted_words[i];
    }

    return result;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (sort_numbers("") == "");
    assert (sort_numbers("three") == "three");
    assert (sort_numbers("three five nine") == "three five nine");
     assert (sort_numbers("five zero four seven nine eight") == "zero four five seven eight nine");
      assert (sort_numbers("six five four three two one zero") == "zero one two three four five six");
}

