string decode_cyclic(string s) {
    string output;
    for (int i = 0; i * 3 < s.length(); ++i) {
        string group = s.substr(i * 3, 3);
        if (group.length() == 3) {
            char c = group[2];
            group = c + group.substr(0, 2);
        }
        output += group;
    }
    return output;
}

