bool is_prime(int num) {
    if (num <= 1) return false;
    for (int i = 2; i * i <= num; ++i) {
        if (num % i == 0) return false;
    }
    return true;
}

int prime_fib(int n) {
    int count = 0;
    int a = 2, b = 3;

    while (true) {
        if (is_prime(a)) {
            count++;
            if (count == n) return a;
        }
        // Generate next Fibonacci number
        int next = a + b;
        a = b;
        b = next;
    }
}


