bool triples_sum_to_zero(vector<int> l) {
    int n = l.size();
    if (n < 3) return false;

    sort(l.begin(), l.end());

    for (int i = 0; i < n - 2; ++i) {
        int j = i + 1, k = n - 1;
        while (j < k) {
            int sum = l[i] + l[j] + l[k];
            if (sum == 0) return true;
            else if (sum < 0) ++j;
            else --k;
        }
    }
    return false;
}


