using namespace std;

bool monotonic(vector<float> l) {
    if (l.size() <= 1) return true;

    bool increasing = true;
    for (int i = 1; i < l.size(); ++i) {
        if (l[i] < l[i-1]) {
            increasing = false;
            break;
        }
    }

    if (increasing) return true;

    bool decreasing = true;
    for (int i = 1; i < l.size(); ++i) {
        if (l[i] > l[i-1]) {
            decreasing = false;
            break;
        }
    }

    return decreasing;
}

