vector<int> factorize(int n) {
    vector<int> factors;

    if (n < 2) {
        return factors; // Return empty as per edge case handling
    }

    // Handle divisibility by 2
    while (n % 2 == 0) {
        factors.push_back(2);
        n /= 2;
    }

    // Check for odd factors starting from 3
    for (int i = 3; i * i <= n; i += 2) {
        while (n % i == 0) {
            factors.push_back(i);
            n /= i;
        }
    }

    // If remaining n is a prime number greater than 2
    if (n > 2) {
        factors.push_back(n);
    }

    return factors;
}

int largest_prime_factor(int n) {
    vector<int> factors = factorize(n);
    if (factors.empty()) {
        return -1; // No prime factors for numbers less than 2
    }
    return factors.back(); // The last element is the largest prime factor
}


