2. **Iterative Calculation**:
   - For values of `n` greater than 2, use three variables to keep track of the previous three values in the sequence.
   - Initialize these variables with the known values for `n = 0`, `n = 1`, and `n = 2`.
   - Iterate from 3 up to `n`, updating the variables at each step to reflect the current value based on the sum of the previous three values.

This approach ensures that we only use a constant amount of space (O(1)) and compute the result in linear time (O(n)), making it efficient for large values of `n`.

