vector<int> findSmallestEvenIndex(const vector<int>& arr) {
    int min_even_value = INT_MAX;
    int min_index = -1;

    for (int i = 0; i < arr.size(); ++i) {
        if (arr[i] % 2 == 0) { // Check if the number is even
            if (min_index == -1) {
                min_even_value = arr[i];
                min_index = i;
            } else {
                if (arr[i] < min_even_value) {
                    min_even_value = arr[i];
                    min_index = i;
                }
            }
        }
    }

    if (min_index == -1) {
        return {}; // No even number found
    } else {
        return {min_even_value, min_index};
    }
}

