string circular_shift(int x, int shift){  // Fixed function name to match declaration
    bool isNegative = false;
    if(x < 0){
        isNegative = true;
        x = -x;
    }
    string s = to_string(x);
    int n = s.length();

    if(shift != 0){
        if(shift > n){
            reverse(s.begin(), s.end());
        } else {
            int effectiveShift = shift % n;
            if(effectiveShift != 0){
                string shiftedPart = s.substr(n - effectiveShift);
                s = shiftedPart + s.substr(0, n - effectiveShift);
            }
        }
    }

    if(isNegative){
        s = "-" + s;
    }

    return s;
}

