int fruit_distribution(string s, int n) {
    size_t pos = s.find(" and ");
    string apples_part = s.substr(0, pos);
    string oranges_part = s.substr(pos + 5);

    // Extract apples count
    size_t space_pos_apples = apples_part.find(' ');
    string apples_str = apples_part.substr(0, space_pos_apples);
    int apples = stoi(apples_str);

    // Extract oranges count
    size_t space_pos_oranges = oranges_part.find(' ');
    string oranges_str = oranges_part.substr(0, space_pos_oranges);
    int oranges = stoi(oranges_str);

    int total_apple_orange = apples + oranges;
    return n - total_apple_orange;
}

