int search(vector<int> lst) {
    unordered_map<int, int> freq;
    for (int num : lst) {
        freq[num]++;
    }

    vector<int> valid_numbers;
    for (auto& pair : freq) {
        int num = pair.first;
        int count = pair.second;
        if (count >= num) {
            valid_numbers.push_back(num);
        }
    }

    if (valid_numbers.empty()) {
        return -1;
    } else {
        int max_num = *max_element(valid_numbers.begin(), valid_numbers.end());
        return max_num;
    }
}

