vector<int> strange_sort_list(vector<int> lst) {
    if (lst.empty()) return {};

    vector<int> sorted = lst;
    sort(sorted.begin(), sorted.end());

    vector<int> result;
    bool pickLeft = true;
    int left = 0, right = sorted.size() - 1;

    while (left <= right) {
        if (pickLeft) {
            result.push_back(sorted[left]);
            left++;
        } else {
            result.push_back(sorted[right]);
            right--;
        }
        pickLeft = !pickLeft;
    }

    return result;
}

