bool will_it_fly(vector<int> q, int w) {
    // Check if the vector is a palindrome
    vector<int> rev = q;
    reverse(rev.begin(), rev.end());
    if (q != rev) {
        return false;
    }

    // Calculate the total sum of elements
    int total = 0;
    for (int num : q) {
        total += num;
    }
    if (total > w) {
        return false;
    }

    return true;
}

