string decimal_to_binary(int decimal) {
    if (decimal == 0) {
        return "db0db";
    }
    string binary;
    while (decimal > 0) {
        int remainder = decimal % 2;
        binary.push_back('0' + remainder);
        decimal /= 2;
    }
    reverse(binary.begin(), binary.end());
    return "db" + binary + "db";
}

