string solve(int N) {
    if (N == 0) {
        return "0";
    }
    int sum = 0;
    int temp = N;
    while (temp > 0) {
        sum += temp % 10;
        temp /= 10;
    }
    string binary;
    if (sum == 0) {
        return "0";
    }
    while (sum > 0) {
        int rem = sum % 2;
        binary.push_back(rem + '0');
        sum /= 2;
    }
    reverse(binary.begin(), binary.end());
    return binary;
}

