string anti_shuffle(string s) {
    // Split the string into words based on spaces
    vector<string> words;
    stringstream ss(s);
    string word;
    while (ss >> word) {
        words.push_back(word);
    }

    // Process each word to sort its characters
    for (auto &w : words) {
        sort(w.begin(), w.end());
    }

    // Rebuild the string with sorted words
    string result = "";
    for (size_t i = 0; i < words.size(); ++i) {
        if (i > 0) {
            result += " ";
        }
        result += words[i];
    }

    return result;
}

