int sum_digits(int n) {
    int sum = 0;
    while (n > 0) {
        sum += n % 10;
        n /= 10;
    }
    return sum;
}

int skjkasdkd(vector<int> lst) {
    int max_prime = -1;
    for (int num : lst) {
        if (num < 2) continue;
        if (is_prime(num)) {
            if (num > max_prime) {
                max_prime = num;
            }
        }
    }
    if (max_prime == -1) return 0; // No primes found
    return sum_digits(max_prime);
}

