string encode(string message) {
    // Swap case for each character
    for (char &c : message) {
        if (islower(c)) {
            c = toupper(c);
        } else if (isupper(c)) {
            c = tolower(c);
        }
    }

    // Replace vowels with the next vowel in sequence
    string vowels = "aeiouAEIOU";
    string replacement = "eiouaEIouA";

    for (size_t i = 0; i < message.size(); ++i) {
        size_t pos = vowels.find(message[i]);
        if (pos != string::npos) {
            message[i] = replacement[pos];
        }
    }

    return message;
}

