bool check_dict_case(map<string, string> dict) {
    if (dict.empty()) {
        return false;
    }

    auto it = dict.begin();
    string first_key = it->first;
    if (first_key.empty()) {
        return false;
    }

    bool is_first_lower = true;
    bool is_first_upper = true;

    for (char c : first_key) {
        if (!islower(c)) {
            is_first_lower = false;
        }
        if (!isupper(c)) {
            is_first_upper = false;
        }
    }

    if (!(is_first_lower || is_first_upper)) {
        return false;
    }

    bool expected_lower = is_first_lower;

    for (++it; it != dict.end(); ++it) {
        string key = it->first;
        if (key.empty()) {
            return false;
        }

        bool current_is_lower = true;
        bool current_is_upper = true;

        for (char c : key) {
            if (!islower(c)) {
                current_is_lower = false;
            }
            if (!isupper(c)) {
                current_is_upper = false;
            }
        }

        if (!(current_is_lower || current_is_upper)) {
            return false;
        }

        if (expected_lower != current_is_lower) {
            return false;
        }
    }

    return true;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (check_dict_case({{"p","pineapple"}, {"b","banana"}}) == true);
    assert (check_dict_case({{"p","pineapple"}, {"A","banana"}, {"B","banana"}}) == false);
    assert (check_dict_case({{"p","pineapple"}, {"5","banana"}, {"a","apple"}}) == false);
    assert (check_dict_case({{"Name","John"}, {"Age","36"}, {"City","Houston"}}) == false);
    assert (check_dict_case({{"STATE","NC"}, {"ZIP","12345"} }) == true  );
    assert (check_dict_case({{"fruit","Orange"}, {"taste","Sweet"} }) == true  );
    assert (check_dict_case({}) == false);
}

