string rounded_avg(int n, int m) {
    if (n > m) {
        return "-1";
    }

    int count = m - n + 1;
    long sum = static_cast<long>(n + m) * count / 2;
    int avg = sum / count;

    if (avg == 0) {
        return "0";
    }

    string bin_str;
    while (avg > 0) {
        int rem = avg % 2;
        bin_str += ('0' + rem);
        avg /= 2;
    }
    reverse(bin_str.begin(), bin_str.end());

    return bin_str;
}

