int choose_num(int x, int y) {
    if (x > y) {
        return -1;
    }
    int max_num = y;
    if (max_num % 2 == 0) {
        return max_num;
    } else {
        int candidate = max_num - 1;
        if (candidate >= x) {
            return candidate;
        } else {
            return -1;
        }
    }
}

