vector<int> unique_digits(vector<int> x) {
    vector<int> result;
    for (int num : x) {
        bool hasEven = false;
        int n = num;
        while (n > 0) {
            int digit = n % 10;
            if (digit % 2 == 0) {
                hasEven = true;
                break;
            }
            n /= 10;
        }
        if (!hasEven) {
            result.push_back(num);
        }
    }
    sort(result.begin(), result.end());
    return result;
}

