To solve this problem, we need to count how many numbers in a given array have their digits sum up to a value greater than zero. For negative numbers, the first digit (after the minus sign) is treated as a negative number, while all subsequent digits are added normally.

### Approach
1. **Convert Each Number to String**: This allows us to easily iterate over each digit.
2. **Handle Negative Numbers Differently**:
   - The first digit after the minus sign is subtracted from the total sum.
   - All other digits are added to the total sum.
3. **Sum Digits for Non-Negative Numbers**: Simply add all digits together.
4. **Check Sum Condition**: If the computed sum of digits is greater than zero, increment the count.

