vector<int> f(int n) {
    vector<int> result(n);
    for (int j = 0; j < n; ++j) {
        int i = j + 1;
        if (i % 2 == 0) { // Even case: compute factorial
            int fact = 1;
            for (int k = 2; k <= i; ++k) {
                fact *= k;
            }
            result[j] = fact;
        } else { // Odd case: compute sum using formula
            result[j] = i * (i + 1) / 2;
        }
    }
    return result;
}

