bool move_one_ball(vector<int> arr) {
    if (arr.size() <= 1)
        return true;

    int count = 0;
    for (int i = 0; i < arr.size(); i++) {
        if (arr[i] > arr[(i + 1) % arr.size()])
            count++;
    }

    return count == 1;
}

