long long minSubArraySum(vector<long long> nums) {
    if (nums.empty()) return 0; // Assuming non-empty as per problem constraints

    long long min_sum = nums[0];
    long long current_min = nums[0];

    for (size_t i = 1; i < nums.size(); ++i) {
        current_min = min(nums[i], current_min + nums[i]);
        if (current_min < min_sum) {
            min_sum = current_min;
        }
    }

    return min_sum;
}

