    if (lst.size() <= 1) return true;

    int prev = lst[0];
    int count = 1;

    for (size_t i = 1; i < lst.size(); ++i) {
        if (lst[i] < prev) {
            return false;
        }

        if (lst[i] == prev) {
            count++;
            if (count > 2) {
                return false;
            }
        } else {
            count = 1;
        }

        prev = lst[i];
    }

    return true;
}

