vector<string> split_words(string txt) {
    // Check for any whitespace character
    bool hasWhitespace = false;
    for (char c : txt) {
        if (isspace(c)) {
            hasWhitespace = true;
            break;
        }
    }

    if (hasWhitespace) {
        vector<string> result;
        stringstream ss(txt);
        string word;
        while (ss >> word) {  // This skips any whitespace
            result.push_back(word);
        }
        return result;
    } else {
        // Check for commas
        bool hasComma = false;
        for (char c : txt) {
            if (c == ',') {
                hasComma = true;
                break;
            }
        }

        if (hasComma) {
            vector<string> result;
            size_t start = 0;
            size_t end = txt.find(',');
            while (end != string::npos) {
                result.push_back(txt.substr(start, end - start));
                start = end + 1;
                end = txt.find(',', start);
            }
            // Add the last part
            result.push_back(txt.substr(start));
            return result;
        } else {
            // Count lowercase letters with odd positions (0-based)
            int count = 0;
            for (size_t i = 0; i < txt.size(); ++i) {
                if (islower(txt[i]) && (i % 2 == 1)) {  // Odd index
                    count++;
                }
            }
            return vector<string>(1, to_string(count));
        }
    }
}

