bool is_prime(int n) {
    if (n <= 1)
        return false;
    if (n == 2)
        return true;
    if (n % 2 == 0)
        return false;
    for (int i = 3; i * i <= n; i += 2) {
        if (n % i == 0)
            return false;
    }
    return true;
}

string intersection(vector<int> interval1, vector<int> interval2) {
    int a_start = interval1[0];
    int a_end = interval1[1];
    int b_start = interval2[0];
    int b_end = interval2[1];

    int max_start = max(a_start, b_start);
    int min_end = min(a_end, b_end);

    if (max_start > min_end) {
        return "NO";
    }

    int length = min_end - max_start + 1;

    return is_prime(length) ? "YES" : "NO";
}

