int prod_signs(vector<int> arr) {
    if (arr.empty()) return -32768;

    int sum = 0;
    int sign_product = 1;
    bool has_zero = false;

    for (int num : arr) {
        sum += abs(num);

        if (num == 0) {
            has_zero = true;
        } else if (num < 0) {
            sign_product *= -1;
        }
    }

    if (has_zero) {
        return 0;
    }

    return sum * sign_product;
}

