int digits(int n) {
    int product = 1;
    bool has_odd = false;
    while (n > 0) {
        int digit = n % 10;
        if (digit % 2 != 0) { // Check if the digit is odd
            product *= digit;
            has_odd = true;
        }
        n /= 10; // Move to the next digit
    }
    return has_odd ? product : 0;
}

