vector<int> largest_smallest_integers(vector<int> lst) {
    vector<int> negatives;
    vector<int> positives;

    for (int num : lst) {
        if (num < 0) {
            negatives.push_back(num);
        } else if (num > 0) {
            positives.push_back(num);
        }
    }

    int max_neg = 0;
    if (!negatives.empty()) {
        max_neg = *max_element(negatives.begin(), negatives.end());
    }

    int min_pos = 0;
    if (!positives.empty()) {
        min_pos = *min_element(positives.begin(), positives.end());
    }

    return {max_neg, min_pos};
}

