string fix_spaces(string text) {
    string result;
    int space_count = 0;

    for (char c : text) {
        if (c == ' ') {
            space_count++;
        } else {
            // Process accumulated spaces
            if (space_count > 0) {
                if (space_count >= 3) {
                    result += '-';
                } else {
                    for (int i = 0; i < space_count; i++) {
                        result += ' ';
                    }
                }
                space_count = 0;
            }
            result += c;
        }
    }

    // Process any remaining spaces at the end of the string
    if (space_count > 0) {
        if (space_count >= 3) {
            result += '-';
        } else {
            for (int i = 0; i < space_count; i++) {
                result += ' ';
            }
        }
    }

    return result;
}

