string file_name_check(string file_name) {
    // Check for exactly one dot
    int dot_count = 0;
    for (char c : file_name) {
        if (c == '.') {
            dot_count++;
        }
    }
    if (dot_count != 1) {
        return "No";
    }

    size_t dot_pos = file_name.find('.');
    string prefix = file_name.substr(0, dot_pos);
    string suffix = file_name.substr(dot_pos + 1);

    // Check prefix is not empty and starts with a letter
    if (prefix.empty()) {
        return "No";
    }
    char first_char = prefix[0];
    if (!isalpha(first_char)) {
        return "No";
    }

    // Check suffix is one of the allowed types
    vector<string> allowed_suffixes = {"txt", "exe", "dll"};
    bool valid_suffix = false;
    for (string s : allowed_suffixes) {
        if (suffix == s) {
            valid_suffix = true;
            break;
        }
    }
    if (!valid_suffix) {
        return "No";
    }

    // Count digits in the entire filename
    int digit_count = 0;
    for (char c : file_name) {
        if (isdigit(c)) {
            digit_count++;
        }
    }
    if (digit_count > 3) {
        return "No";
    }

    // All checks passed
    return "Yes";
}

