bool is_prime(int n) {
    if (n <= 1) return false;
    if (n == 2) return true;
    if (n % 2 == 0) return false;
    for (int i = 3; i * i <= n; i += 2) {
        if (n % i == 0)
            return false;
    }
    return true;
}

string words_in_sentence(string sentence) {
    vector<string> result_words;
    stringstream ss(sentence);
    string word;

    while (ss >> word) {
        int len = word.length();
        if (is_prime(len)) {
            result_words.push_back(word);
        }
    }

    if (result_words.empty()) {
        return "";
    }

    string output;
    for (size_t i = 0; i < result_words.size(); ++i) {
        if (i != 0) {
            output += " ";
        }
        output += result_words[i];
    }

    return output;
}

