void parseFraction(const string& s, long long& num, long long& den) {
    size_t slash_pos = s.find('/');
    if (slash_pos == string::npos) {
        num = stoll(s);
        den = 1;
    } else {
        string num_str = s.substr(0, slash_pos);
        string den_str = s.substr(slash_pos + 1);
        num = stoll(num_str);
        den = stoll(den_str);
    }
}

long long gcd(long long a, long long b) {
    a = abs(a);
    b = abs(b);
    while (b != 0) {
        long long temp = b;
        b = a % b;
        a = temp;
    }
    return a;
}

bool simplify(string x, string n) {
    long long x_num, x_den;
    parseFraction(x, x_num, x_den);

    long long n_num, n_den;
    parseFraction(n, n_num, n_den);

    long long total_num = x_num * n_num;
    long long total_den = x_den * n_den;

    if (total_num == 0) {
        return true;
    }

    long long g = gcd(abs(total_num), abs(total_den));
    long long simplified_den = total_den / g;

    return simplified_den == 1;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (simplify("1/5", "5/1") == true);
    assert (simplify("1/6", "2/1") == false);
    assert (simplify("5/1", "3/1") == true);
    assert (simplify("7/10", "10/2") == false);
    assert (simplify("2/10", "50/10") == true);
    assert (simplify("7/2", "4/2") == true);
    assert (simplify("11/6", "6/1") == true);
    assert (simplify("2/3", "5/2") == false);
    assert (simplify("5/2", "3/5") == false);
    assert (simplify("2/4", "8/4") == true);
    assert (simplify("2/4", "4/2") == true);
    assert (simplify("1/5", "5/1") == true);
    assert (simplify("1/5", "1/5") == false);
}

