vector<string> bf(string planet1, string planet2) {
    vector<string> planets = {"Mercury", "Venus", "Earth", "Mars", 
                              "Jupiter", "Saturn", "Uranus", "Neptune"};

    int i1 = -1;
    for (int i = 0; i < planets.size(); ++i) {
        if (planets[i] == planet1) {
            i1 = i;
            break;
        }
    }

    int i2 = -1;
    for (int i = 0; i < planets.size(); ++i) {
        if (planets[i] == planet2) {
            i2 = i;
            break;
        }
    }

    // If either planet is not found, return empty vector
    if (i1 == -1 || i2 == -1) {
        return {};
    }

    // If both planets are the same, return empty vector
    if (i1 == i2) {
        return {};
    }

    int start = min(i1, i2);
    int end = max(i1, i2);

    vector<string> result;
    for (int i = start + 1; i < end; ++i) {
        result.push_back(planets[i]);
    }

    return result;
}

