int get_digit_sum(int n) {
    if (n == 0) return 0;
    n = abs(n);
    int sum = 0;
    while (n != 0) {
        sum += n % 10;
        n /= 10;
    }
    return sum;
}

vector<int> order_by_points(vector<int> nums) { // Renamed function to match declaration
    struct Element {
        int num;
        int sum;
        int index;
    };

    vector<Element> elements;
    for (int i = 0; i < nums.size(); ++i) {
        int s = get_digit_sum(nums[i]);
        elements.push_back({nums[i], s, i});
    }

    sort(elements.begin(), elements.end(), [](const Element& a, const Element& b) {
        if (a.sum != b.sum) {
            return a.sum < b.sum;
        } else {
            return a.index < b.index;
        }
    });

    vector<int> res;
    for (const auto& e : elements) {
        res.push_back(e.num);
    }
    return res;
}

