vector<int> even_odd_count(int num) {
    if (num == 0) {
        return {1, 0};
    }
    int abs_num = abs(num);
    int even_count = 0;
    int odd_count = 0;
    while (abs_num != 0) {
        int digit = abs_num % 10;
        if (digit % 2 == 0) {
            even_count++;
        } else {
            odd_count++;
        }
        abs_num /= 10;
    }
    return {even_count, odd_count};
}

