bool rightAngled(float a, float b, float c) {
    if (a <= 0 || b <= 0 || c <= 0) {
        return false;
    }

    // Check triangle inequality
    if (!( (a + b > c) && (a + c > b) && (b + c > a) )) {
        return false;
    }

    vector<float> sides = {a, b, c};
    sort(sides.begin(), sides.end());

    float a_sq = sides[0] * sides[0];
    float b_sq = sides[1] * sides[1];
    float c_sq = sides[2] * sides[2];

    const float EPSILON = 1e-6;
    return abs(a_sq + b_sq - c_sq) < EPSILON;
}

