vector<int> generate_integers(int a, int b) {
    int start = min(a, b);
    int end = max(a, b);
    vector<int> result;

    for (int i = start; i <= end; ++i) {
        if (i % 2 == 0 && i >= 1 && i <= 9) {
            result.push_back(i);
        }
    }

    return result;
}

